import React, { Component } from "react";
import Navigation from "./Navigation";
import { Typography, Select, MenuItem, Input } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

class Contact extends Component {
  state = { projectRequest: false, requestedProjects: [], rating: 0 };
  render() {
    let spacer = {
      height: "0",
      width: "100%",
    };

    const labels = {
      0.5: "Find a new hobby",
      1: "At least you tried Dev",
      1.5: "Reminds me of a ps1 UI",
      2: "Reminds me of a ps2 UI",
      2.5: "Ok",
      3: "Average",
      3.5: "'Above Average'",
      4: "Upper-Mid Tier",
      4.5: "Like 4k Graphics",
      5: "How is this even free?",
    };

    const useStyles = makeStyles({
      root: {
        width: 200,
        display: "flex",
        alignItems: "center",
      },
    });

    const [value, setValue] = React.useState(2);
    const [hover, setHover] = React.useState(-1);
    const classes = useStyles();

    const ITEM_HEIGHT = 48;
    const ITEM_PADDING_TOP = 8;
    const MenuProps = {
      PaperProps: {
        style: {
          maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
          width: 250,
        },
      },
    };

    const projects = [
      "Euchre",
      "Fakebook",
      "CPU Sim",
      "Wheel of Fortune",
      "Budget Tracker",
      "Insta485 (Server side dynamic)",
      "Insta485 (Client side dynamic)",
      "MapReduce Server",
      "Search Engine",
      "Crypto Project",
      "Web Security",
      "MITM Attacks",
      "Appsec and Buffer Overflows",
    ];

    const handleChange = (event) => {
      this.setState({
        requestedProjects: event.target.value,
      });
    };

    return (
      <div>
        <Navigation />
        <Typography variant="h4" align="center" style={{ marginTop: "3vh" }}>
          Want to get ahold of me?
        </Typography>
        <div className={spacer}></div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",

            height: "100vh",
            flexWrap: "wrap",
          }}
        >
          <div>
            <div style={{ height: "5vh", width: "100%" }}></div>
            <Typography variant="h6" align="center">
              Select projects to request
            </Typography>
            <div className={spacer}></div>
            <Typography variant="body2" color="textSecondary" align="center">
              Optional - I Will only comply if I can verify you are not, or
              never will be, a college student who could use this to cheat.
            </Typography>
            <div
              style={{
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                marginTop: "3vh",
              }}
            >
              <Select
                style={{ width: "20%", alignSelf: "center" }}
                multiple
                value={this.state.requestedProjects}
                onChange={handleChange}
                MenuProps={MenuProps}
                input={<Input />}
              >
                {projects.map((name) => (
                  <MenuItem key={name} value={name}>
                    {name}
                  </MenuItem>
                ))}
              </Select>
            </div>
            <Typography
              variant="h6"
              align="center"
              style={{ marginTop: "5vh" }}
            >
              Rate my Website!
            </Typography>
            <div className={spacer}></div>
            <Typography variant="body2" color="textSecondary" align="center">
              Again, optional, but I really appreciate feedback and tips/ideas
              to try!
            </Typography>
          </div>
        </div>
      </div>
    );
  }
}

export default Contact;
